import React from 'react'

class FirstTabs extends React.Component {
    constructor(props){
        super(props)
    }

render(){
    return (
        <div>
            <span>{this.props.tabList.i}</span><span>{this.props.user}</span>
            {this.props.number}
            {this.props.type}
            <span>{this.props.upOrDown}</span><span>{this.props.howMany}</span>
        </div>
    )
}

}

export default FirstTabs
